import React from 'react';
import { btnArr } from '../../js/Btns';
import CompBtn from './CompBtn';

const CompCalc = () => {
  return (
    <section className="calc">
      <h2>Calculator</h2>
      <p className="output">1+1</p>
      <ul className="btn-container">
        {
          btnArr.map(v=><CompBtn/>)
        }
      </ul>
    </section>
  );
};

export default CompCalc;
